import React from 'react';
import './style.css';
const GlobalCorona = () => {
	return (
		<section className="global__corona">
			<div className="global__item">
				<p>-Moi nhiem: 123123 </p>
				<p>-Tong ca nhiem: 123123 </p>
			</div>
			<div className="global__item">
				<p>-Moi tu vong: 123123 </p>
				<p>-Tong ca tu vong: 123123 </p>
			</div>
			<div className="global__item">
				<p>-Moi khoi benh: 123123 </p>
				<p>-Tong ca khoi benh: 123123 </p>
			</div>
		</section>
	);
};
export const Global = () => {
	GlobalCorona();
};
